import React from 'react';
import './Footer.css';

const Footer = () => {
  return (
    <section className="about-section">
      <div className="about-content">
        <div className="about-text">
          <h2 className="about-title">About Me</h2>
          <p className="about-description">
            Hello, I'm Marc Anthony Casale, a passionate web developer with over 6 years of experience. I specialize in creating
            modern, user-friendly websites and applications that solve real-world problems. I love combining design with technology
            to build beautiful and functional digital solutions.
          </p>
        </div>
        <div className="about-image">
          <img src={`${process.env.PUBLIC_URL}/assets/DP.jpg`} alt="Profile" />
        </div>
      </div>
    </section>


  );
};

export default Footer;
